import React from "react";
//nodejs library that concatenates classes
import classNames from "classnames";
//nodejs library to set properties for components
import PropTypes from "prop-types";
//nodejs library to set properties for components
import styled from 'styled-components';
//@material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
import { unstable_Box as Box } from '@material-ui/core/Box';


import linearProgressStyle from "assets/jss/material-kit-react/components/linearProgressStyle.jsx";

const LinearBar = ({...props}) => {
	const { classes, className, linearbar, skillbar, ...rest} = props;
	const linearBar = classNames({
		[classes[skillbar]]: skillbar
	});
	return (
		<Box className={classes.linearbar} >
			<Box className={linearBar} p={1} my={0.5}>
			HTML5 & CSS3
			</Box>
		</Box>
	)
}

LinearBar.propTypes = {
	classes : PropTypes.object.isrequired,
	skillbar: PropTypes.oneOf([
		"skillbar25",
		"skillbar50",
		"skillbar75",
	])
}

export default withStyles(linearProgressStyle)(LinearBar);
